import React from "react";

import { useAuth0 } from "@auth0/auth0-react";
import Auth0ProviderWithHistoryA2J from ".../auth0-provider-with-history-a2j";

const AdvocateLoginButton = () => {
  const { loginWithRedirect } = useAuth0();

  return (
    <button
      onClick={() => loginWithRedirect()}
      id="qsLoginBtn"
      variant="primary"
      className="circular ui button"
      type="submit"
      style={{
        backgroundColor: "#00282A",
        color: "white",
        width: "20vw",
        marginTop: "6vh",
        marginLeft: "9vh",
      }}
    >
      Advocate Login
    </button>
  );
};

export default AdvocateLoginButton;
